import React from "react"
import NewJob from "./NewJob"
import JobList from "./JobList"

function Jobs (job){
if(job.length){
return (
 <div>
    <p>{job.neighborhood}</p>
    <p>{job.picture}</p>
    <p>{job.worker}</p>
    <p>{job.date}</p>
 </div>
    )}
}
    export default Jobs
